create database prediction_engine;

CREATE TABLE IF NOT EXISTS `uploaded_data` (
    `id` int(11) NOT NULL AUTO_INCREMENT,
    `user_uploaded_file_id` int(11) DEFAULT NULL,
    `CaseID` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
    `Case_Assignee_First_Name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
    `Case_Assignee_Surname` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
    `Region` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
    `SSO` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `Receiving_Country` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `Case_Type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `GE_CoE_Case_Number` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `GE_Business` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `Industry_Focus_Group` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `Case_Initiation_Date` datetime DEFAULT NULL,
    `Proposed_Assignment_From_Date` datetime DEFAULT NULL,
    `Work_Ready_Estimated_Date` datetime DEFAULT NULL,
    `Predicted_Work_Ready_Date` datetime DEFAULT NULL,
    `First_Contact_with_Applicant_Date` datetime DEFAULT NULL, 
    `All_Documents_Received_Date` datetime DEFAULT NULL,
    `Application_sent_to_GE_Signature_Date` datetime DEFAULT NULL,
    `All_Documentation_Received_for_Filing_Date` datetime DEFAULT NULL,
    `Application_Filed_Date` datetime DEFAULT NULL,
    `Application_Finalised_Date` datetime DEFAULT NULL,
    `Last_Action_Code` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
    `Last_Action_Comment` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
    `Last_Action_Date` datetime DEFAULT NULL,
    PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ;


CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `first_name` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `enabled` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




CREATE TABLE `user_uploaded_files` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `filename` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `filepath` varchar(300) COLLATE utf8_unicode_ci NOT NULL,
  `uploaded` datetime NOT NULL,
  `downloaded` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `countries` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `country` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `country_code` varchar(2) COLLATE utf8_unicode_ci NOT NULL,
  `country_code3` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL,
  `enabled` tinyint(1) NOT NULL,
  `created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



CREATE TABLE `country_procedures` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `country_id` int(11) DEFAULT NULL,
  `procedure_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `procedure_name_desription` varchar(500) COLLATE utf8_unicode_ci NOT NULL,
  `enabled` tinyint(1) NOT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `procedure_benchmarks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `procedure_id` int(11) NOT NULL,
  `benchmark_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `benchmark_name_description` varchar(500) COLLATE utf8_unicode_ci default NULL,
  `benchmark_reference_field_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `estimated_days` tinyint(2) NOT NULL,
  `estimated_days_description` varchar(500) COLLATE utf8_unicode_ci default NULL,  
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

